import React, { useState, useEffect } from 'react'
import Cancel from '../Button/Cancel';


const WeeklyUpdate = (props) => {

  const [formValues, setFormValues] = useState({
    TMFixedCost: "",
    WeeklyCompletion: "",
    FeaturesCompleted: "",
    Dependencies: "",
    RisksMitigation: "",
    Risks: "",
    SupportRequired: ""
  });
  const [validation, setValidation] = useState({
    TMFixedCost: "",
    WeeklyCompletion: "",
    FeaturesCompleted: "",
    Dependencies: "",
    RisksMitigation: "",
    Risks: "",
    SupportRequired: ""
  });




  const handleChange = (event, type) => {
    debugger
    const { name, value } = event.target;
    setFormValues({ ...formValues, [type]: value });
    // console.log(formValues);
  }




  const handleSubmit = (e) => {

    e.preventDefault();

    let errors = validation;
    if (!formValues.TMFixedCost.trim()) {
      errors.TMFixedCost = "*Required";
    }
    else {
      errors.TMFixedCost = "";
    }
    if (!formValues.WeeklyCompletion.trim()) {
      errors.WeeklyCompletion = "*Required";
    }
    else {
      errors.WeeklyCompletion = "";
    }
    if (!formValues.FeaturesCompleted.trim()) {
      errors.FeaturesCompleted = "*Required";
    }

    else {
      errors.FeaturesCompleted = "";
    }

    if (!formValues.Dependencies.trim()) {
      errors.Dependencies = "*Required";
    }
    else {
      errors.Dependencies = "";
    }
    if (!formValues.RisksMitigation.trim()) {
      errors.RisksMitigation = "*Required";
    }
    else {
      errors.RisksMitigation = "";
    }
    if (!formValues.Risks.trim()) {
      errors.Risks = "*Required";
    }
    else {
      errors.Risks = "";
    }
    if (!formValues.SupportRequired.trim()) {
      errors.SupportRequired = "*Required";
    }
    else {
      errors.SupportRequired = "";

    }

    return setValidation(errors);

  };






  return (props.trigger) ? (

    <form style={{
      position: "absolute",
      width: "144rem",
      top: "2rem",
      left: "10.5%",
      backgroundColor: "rgba(0,0,0,0.5",
    }}
      onSubmit={handleSubmit}
    >

      {console.log("appko",Object.keys(formValues))
}
      <div className='WeeklyUpdate'>

